from fastapi import FastAPI, HTTPException, UploadFile, File
from pydantic import BaseModel
import os
from google import genai
from google.genai import types
from dotenv import load_dotenv
import io
import base64

# Load environment variables
load_dotenv()

app = FastAPI()

client = genai.Client(api_key=os.environ.get("GEMINI_API_KEY"))

MODEL_NAME = "gemini-2.5-flash-preview-05-20"

class PredictionResponse(BaseModel):
    result: str

def generate(image_content):
    try: 
        image_b64 = base64.b64encode(image_content).decode()
        contents = [
            types.Content(
                role="user",
                parts=[
                    types.Part.from_bytes(
                        mime_type="image/jpeg",
                        data=base64.b64decode(
                            """"""
                        ),
                    ),
                    types.Part.from_text(text="""give me the name of fruits and vegetables in the image in the javascript array format, only give me the array"""),
                ],
            ),
            types.Content(
                role="model",
                parts=[
                    types.Part.from_text(text="""The user wants a javascript array of fruits and vegetables in the image.
    The image contains kiwis.
    Kiwis are fruits.
    So the array should contain \"kiwi\"."""),
                    types.Part.from_text(text="""```javascript
    [\"kiwi\"]
    ```"""),
                ],
            ),
            types.Content(
                role="user",
                parts=[
                    types.Part.from_bytes(
                        mime_type="image/jpeg",
                        data=image_content,
                    ),
                    types.Part.from_text(text="""give me the name of fruits and vegetables in the image in the javascript array format, only give me the array"""),
                ],
            ),
        ]
        generate_content_config = types.GenerateContentConfig(
            temperature=0.7,
            top_p=0.95,
            top_k=64,
            response_mime_type="text/plain",
            thinking_config=types.ThinkingConfig(thinking_budget=0)
        )
        response_text = ""
        for chunk in client.models.generate_content_stream(
            model=MODEL_NAME,
            contents=contents,
            config=generate_content_config,
        ):
            if chunk.text:
                response_text += chunk.text
        return response_text.strip()
    except Exception as e:
        raise Exception(f"Error generating content: {str(e)}")

@app.post("/detect-fruit-veggie/", response_model=PredictionResponse)
async def detect_fruit_veggie(file: UploadFile = File(...)):
    if not file.content_type or not file.content_type.startswith("image/"):
        raise HTTPException(status_code=400, detail="File must be an image")
    
    try:
        image_content = await file.read()
        
        result = generate(image_content)
        
        return PredictionResponse(result=result)
        
    except Exception as e:
        raise HTTPException(status_code=500, detail=f"Error during prediction: {str(e)}")


